/*_sql_Курсовая работа_____________________

  _База данных_"Сеть агентств недвижимости"
  _________________________________________
   										   

-- 1.	Общее текстовое описание БД и решаемых ею задач.

		Представляю БД, разработанную на основе прогрессивной модели действующей федеральной сети агентств недвижимости.
Особенностями данной модели являются следующие факторы:
- в системе иерархии предусмотрены, по возрастанию, позиции агента (agent), менеджера (manager), директора (director), 
директора по развитию (city_dir) и генерального директора (gen_dir), причем допустимо подчинение минуя звенья, например, 
под руководством директора могут быть как менеджеры, так и агенты напрямую;
- вести договоры (по продаже или покупке объектов недвижимости) может любой сотрудник независимо от должности;
- менеджер или любой вышестоящий руководитель может иметь различные команды в разных офисах и даже городах.

В БД описаны: 
1. Города присутствия (cities),
2. Филиалы/офисы (branches),
3. Штат сотрудников (staff),
4. Должности (positions),
5. Связь сотрудник - офис приписки, и непосредственный руководитель (staff_branches)
PRIMARY KEY (staff_id, branches_id), чтобы не было двух записей о сотруднике и основном офисе, к которому он приписан,
а у непосредственного руководителя (chief_staff_id) могут быть в подчинении и другие сотрудники, и другие офисы.
6. Основные данные сотрудников (profiles),
7. Договоры с клиентами (contracts),
8. Клиенты/собственники или покупатели недвижимости (customers),
9. Объекты недвижимости (real_estate),
10. Типы объектов недвижимости (real_estate_types),
11. Медиаинфо объектов (portfolio)

С помощью представленных заданий реализован основной функционал для комфортной работы с данными о сотрудниках, подчинении и подсетях,
реализована работа с объектами недвижимости в связке с соответствующими договорами, заказчиками и непосредственными исполнителями. 
Реализованы удобные представления и выборки данных, хранимые процедуры и ограничения для ввода корректных значений.
Для проверки вариантов работы БД с различными данными и правильного задания системы подчинения, данные в таблицу staff_branches
задаются случайным образом по алгоритму в соответствующей хранимой процедуре. В редких случаях, после загрузки скриптов создания 
и наполнения БД, в некоторых задачах может наблюдаться маленькое число данных. В таком случае, тестовые задачи возможно повторно
проверить после повторного запуска скриптов создания и наполнения БД.

В дальнейшем будет реализовываться расширение БД и функционал по системе мотивации и расчетов, а также по развитию полноты хранимых данных 
об объектах недвижимости и вариантам их обработки.*/


-- 2, 3.	Количество таблиц - 11. Скрипты создания структуры БД (с первичными ключами, индексами, внешними ключами).

DROP DATABASE IF EXISTS fed_real_estate_ag;
CREATE DATABASE fed_real_estate_ag;
USE fed_real_estate_ag;

DROP TABLE IF EXISTS staff;
CREATE TABLE staff (
	id SERIAL PRIMARY KEY,
	position_id BIGINT UNSIGNED NULL,
    firstname VARCHAR(100),
    lastname VARCHAR(100) COMMENT 'Фамилия',
    email VARCHAR(100) UNIQUE,
    phone BIGINT,
    is_fired bit DEFAULT 0 COMMENT 'Уволен',
    INDEX staff_firstname_lastname_idx(firstname, lastname)
);

DROP TABLE IF EXISTS positions;
CREATE TABLE positions (
	id SERIAL PRIMARY KEY,
	name VARCHAR(100), 			-- 'agent', 'manager', 'director', 'city_dir', 'gen_dir'
	established_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);

ALTER TABLE staff ADD CONSTRAINT fk_positions_id
    FOREIGN KEY (position_id) REFERENCES positions(id) ON UPDATE CASCADE ON DELETE NO ACTION;

DROP TABLE IF EXISTS profiles;
CREATE TABLE profiles (
	staff_id SERIAL PRIMARY KEY,
    gender CHAR(1),
    birthday DATE,
	photo_filename VARCHAR(100),
	city_id BIGINT UNSIGNED NULL,
    created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    FOREIGN KEY (staff_id) REFERENCES staff(id) ON UPDATE CASCADE ON DELETE CASCADE
);

DROP TABLE IF EXISTS cities;
CREATE TABLE cities(
	id SERIAL PRIMARY KEY,
    name VARCHAR(255),
    created_at DATETIME DEFAULT NOW()
);
    
ALTER TABLE profiles ADD CONSTRAINT fk_cities_id
    FOREIGN KEY (city_id) REFERENCES cities(id) ON UPDATE CASCADE ON DELETE SET NULL;

DROP TABLE IF EXISTS branches;
CREATE TABLE branches(
	id SERIAL PRIMARY KEY,
	office_name VARCHAR(150),
	address VARCHAR(255),
	city_id BIGINT UNSIGNED NULL,
	created_at DATETIME DEFAULT NOW(),
	INDEX office_name_idx(office_name),
	FOREIGN KEY (city_id) REFERENCES cities(id) ON UPDATE CASCADE ON DELETE SET NULL
) COMMENT 'Филиалы';

DROP TABLE IF EXISTS staff_branches;  -- У менеджеров и руководителей может быть более одного офиса. В одном офисе может быть различное число сотрудников и руководителей.
CREATE TABLE staff_branches(
	staff_id BIGINT UNSIGNED NOT NULL,
	branches_id BIGINT UNSIGNED NOT NULL,
    chief_staff_id BIGINT UNSIGNED,
	PRIMARY KEY (staff_id, branches_id), -- Чтобы не было двух записей о сотруднике и основном офисе, к которому он приписан. 
										 -- А у непосредственного руководителя (chief_staff_id) могут быть в подчинении сотрудники и из других офисов.
    FOREIGN KEY (staff_id) REFERENCES staff(id) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY (branches_id) REFERENCES branches(id) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY (chief_staff_id) REFERENCES staff(id) ON UPDATE CASCADE ON DELETE CASCADE
);

DROP TABLE IF EXISTS customers;
CREATE TABLE customers(
	id SERIAL PRIMARY KEY,
    firstname VARCHAR(100),
    lastname VARCHAR(100) COMMENT 'Фамилия',
    email VARCHAR(100) UNIQUE,
    phone BIGINT
);

DROP TABLE IF EXISTS contracts;
CREATE TABLE contracts(
	id SERIAL PRIMARY KEY COMMENT 'Номер договора', 
	staff_id BIGINT UNSIGNED COMMENT 'Специалист по недвижимости',
    status ENUM ('actual', 'done', 'terminated'),
    aim ENUM ('for_sale', 'for_buy'),
    customer_id BIGINT UNSIGNED,
    created_at DATETIME DEFAULT NOW(),
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    FOREIGN KEY (staff_id) REFERENCES staff(id) ON UPDATE CASCADE ON DELETE SET NULL
    -- FOREIGN KEY (customer_id) REFERENCES customers(id) ON UPDATE CASCADE ON DELETE SET NULL -- отключен в тестовых целях для реализации задачи 6.5.
);

DROP TABLE IF EXISTS real_estate_types;
CREATE TABLE real_estate_types(
	id SERIAL PRIMARY KEY,
    name VARCHAR(255),
    created_at DATETIME DEFAULT NOW()
);   

DROP TABLE IF EXISTS real_estate;
CREATE TABLE real_estate(
	id SERIAL PRIMARY KEY,
    contract_id BIGINT UNSIGNED,
    real_estate_type_id BIGINT UNSIGNED,
    city_id BIGINT UNSIGNED NOT NULL,
    district VARCHAR(255) COMMENT 'Район города',
    street VARCHAR(255) COMMENT 'Улица',
    building VARCHAR(255) COMMENT 'Дом/корпус',
	apartment TINYINT UNSIGNED COMMENT 'Номер квартиры/помещения',
    `square_m^2` FLOAT UNSIGNED COMMENT 'Площадь в м2',
    num_room TINYINT UNSIGNED COMMENT 'Сколько комнат',
    `floor` TINYINT UNSIGNED COMMENT 'Этаж',
    price DECIMAL (12,2) COMMENT 'Цена',
    notes TEXT COMMENT 'Примечания',
    created_at DATETIME DEFAULT NOW(),
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    FOREIGN KEY (contract_id) REFERENCES contracts(id) ON UPDATE CASCADE ON DELETE SET NULL,
    FOREIGN KEY (real_estate_type_id) REFERENCES real_estate_types(id) ON UPDATE CASCADE ON DELETE SET NULL,
    FOREIGN KEY (city_id) REFERENCES cities(id) ON UPDATE CASCADE ON DELETE NO ACTION 
);

DROP TABLE IF EXISTS portfolio;
CREATE TABLE portfolio(
	id SERIAL PRIMARY KEY,
	real_estate_id BIGINT UNSIGNED NOT NULL,
    file_type VARCHAR(255),
    filename VARCHAR(255),
    `size` INT,
    created_at DATETIME DEFAULT NOW(),
    updated_at DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
    FOREIGN KEY (real_estate_id) REFERENCES real_estate(id) ON UPDATE CASCADE ON DELETE CASCADE
);

