DROP PROCEDURE IF EXISTS staff_branches_100; -- Процедура для вставки записей в staff_branches, при условии, что равный не может руководить равными или вышестщящими.
DELIMITER //
CREATE PROCEDURE staff_branches_100 (num INT)
BEGIN
	DECLARE i INT DEFAULT 1;
	WHILE i <= num DO
		INSERT INTO staff_branches VALUES 
		(i, (SELECT FLOOR(RAND()*20) + 1), (SELECT id FROM staff WHERE (position_id > (SELECT position_id FROM staff WHERE id = i)) AND id != i ORDER BY RAND() LIMIT 1));
		SET i = i + 1;
	END WHILE;
END //
DELIMITER ;
SET @num = 100;
CALL staff_branches_100(@num);

