UPDATE real_estate 
set city_id = (											-- Город объекта должен совпадать с городом офиса
	SELECT b.city_id 
	FROM branches b 
	LEFT JOIN staff_branches sb ON sb.branches_id = b.id 
	LEFT JOIN staff s ON s.id = sb.staff_id 
	LEFT JOIN contracts c ON c.staff_id = s.id 
	WHERE contract_id = c.id 
	);

