-- 6.	Скрипты характерных выборок (включающие группировки, JOIN'ы, вложенные таблицы).

-- 6.1. Найти по структуре всех руководителей первого, в списке сотрудников, агента (сотрудника c минимальным id и positions.name = 'agent'). 
--      Может быть от 1 до 4 руководителей.
(SELECT s.id, (SELECT name FROM positions p WHERE p.id = s.position_id) AS `position`, s.firstname, s.lastname
FROM staff s 
	WHERE position_id = (SELECT id FROM positions WHERE name = 'agent') -- или WHERE name LIKE 'ag%', если не уверены, что название должности указано полностью
	ORDER BY s.id
	LIMIT 1)
UNION
(SELECT s.id, (SELECT name FROM positions p WHERE p.id = s.position_id) AS `position`, s.firstname, s.lastname
FROM staff s 
	WHERE s.id = (SELECT chief_staff_id FROM staff_branches sb WHERE staff_id = 
		(SELECT s.id FROM staff s WHERE position_id = (SELECT id FROM positions WHERE name = 'agent') 
		ORDER BY s.id
		LIMIT 1)))
UNION						
(SELECT s.id, (SELECT name FROM positions p WHERE p.id = s.position_id) AS `position`, s.firstname, s.lastname
FROM staff s 
	WHERE s.id = (SELECT chief_staff_id FROM staff_branches sb WHERE staff_id = 
		(SELECT s.id FROM staff s WHERE s.id = (SELECT chief_staff_id FROM staff_branches sb 
											WHERE staff_id = (SELECT s.id FROM staff s WHERE position_id = (SELECT id FROM positions WHERE name = 'agent') 
		ORDER BY s.id
		LIMIT 1)))))
UNION 
(SELECT s.id, (SELECT name FROM positions p WHERE p.id = s.position_id) AS `position`, s.firstname, s.lastname
FROM staff s 
	WHERE s.id = (SELECT chief_staff_id FROM staff_branches sb WHERE staff_id =
		(SELECT s.id FROM staff s WHERE s.id = (SELECT chief_staff_id FROM staff_branches sb 
											WHERE staff_id = (SELECT s.id FROM staff s 
															WHERE s.id = (SELECT chief_staff_id FROM staff_branches sb WHERE staff_id = 
																(SELECT s.id FROM staff s WHERE position_id = (SELECT id FROM positions WHERE name = 'agent') 
																ORDER BY s.id
																LIMIT 1)))))))
UNION 
(SELECT s.id, (SELECT name FROM positions p WHERE p.id = s.position_id) AS `position`, s.firstname, s.lastname
FROM staff s 									  -- точно знаем, что выше только единственный генеральный директор, поэтому можем найти по названию должности 
	WHERE position_id = (SELECT id FROM positions WHERE name = 'gen_dir')) -- или WHERE name LIKE 'gen%', если не уверены как точно указано название должности
;

-- 6.2. Задан некоторый офис. Найти всех сотрудников этого офиса и их должности.
SELECT b.id, b.office_name, s.firstname, s.lastname, p.name `position`
FROM branches b 
JOIN staff_branches sb ON sb.branches_id = b.id 
JOIN staff s ON sb.staff_id = s.id 
JOIN positions p ON p.id = s.position_id 
WHERE b.id = 1
ORDER BY `position`, s.lastname 
;

-- 6.3. Подсчитать количество всех договоров всех сотрудников заданного директора, например, последнего по списку (positions.name = director). 
--      Не включая договоры, заключенные им самим.
SELECT COUNT(*) AS contracts_cnt, (SELECT id FROM staff s WHERE position_id = (SELECT id FROM positions WHERE name = 'director') ORDER BY id DESC LIMIT 1) dir_id,
								  (SELECT lastname FROM staff s WHERE position_id = (SELECT id FROM positions WHERE name = 'director') ORDER BY id DESC LIMIT 1) lastname,
								  (SELECT firstname FROM staff s WHERE position_id = (SELECT id FROM positions WHERE name = 'director') ORDER BY id DESC LIMIT 1) firstname
FROM contracts c 
WHERE staff_id IN (SELECT staff_id FROM staff_branches sb WHERE chief_staff_id = 
													(SELECT id FROM staff s WHERE position_id = (SELECT id FROM positions WHERE name = 'director') ORDER BY id DESC LIMIT 1))
	 OR staff_id IN (SELECT staff_id FROM staff_branches sb WHERE chief_staff_id IN
	 												(SELECT staff_id FROM staff_branches sb WHERE chief_staff_id = 
													(SELECT id FROM staff s WHERE position_id = (SELECT id FROM positions WHERE name = 'director') ORDER BY id DESC LIMIT 1)))
;

-- 6.4. Выбрать информацию об объектах компании в Нижнем Новгороде, отсортировать по цене по убыванию. 
--      При этом, если цена = 0, вывести эти строки в начале (например, с целью последующей корректировки).
SELECT re.id, re.contract_id, re.real_estate_type_id, c.name city, re.district, re.street, re.building, re.apartment, re.`square_m^2`, re.num_room, re.`floor`, re.price, re.notes
FROM real_estate re
JOIN cities c ON re.city_id = c.id
WHERE c.name = 'N.Novgorod'
ORDER BY CASE
        WHEN re.price = 0 THEN 0
        else 1
    	END, 
    	re.price DESC
;
    
-- 6.5. Из таблицы contracts необходимо извлечь договоры, заключенные с января по май включительно в 2021 г., и из таблицы customers соответствующих клиентов.
--      Если по каким-то причинам допущено, что соответствующий договору клиент может отсутствовать в таблице, данные о договоре всё равно должны выводиться.
SELECT c.id, c.staff_id, c.aim, c.status, c.created_at, c.customer_id, CONCAT (c2.firstname, ' ', c2.lastname) clients_name, c2.email, c2.phone 
FROM contracts c 
LEFT JOIN customers c2 ON c2.id = c.customer_id 
WHERE TIMESTAMPDIFF (DAY, c.created_at, '2021-05-31') <= 151 AND c.created_at <= '2021-05-31'
ORDER BY c.created_at 
;

-- 6.6. Подсчитать средний возраст сотрудников из всех городов сети.
SELECT ROUND(AVG(TIMESTAMPDIFF(YEAR, p.birthday, NOW())), 0) AS age_avg, 
	   (SELECT name FROM cities c WHERE p.city_id = c.id) AS city
FROM profiles p
GROUP BY p.city_id 
ORDER BY age_avg DESC
;

-- 7.	Представления.
-- 7.1. Представление, которое выводит имя и фамилию сотрудника, должность, название и адрес офиса приписки.
CREATE OR REPLACE VIEW v_staff_office (`position`, agents_name, office, city, address) 
									AS SELECT p.name, CONCAT(s.firstname, ' ', s.lastname), b.office_name, c.name, b.address
FROM branches b 
LEFT JOIN staff_branches sb ON sb.branches_id = b.id 
LEFT JOIN staff s ON sb.staff_id = s.id 
LEFT JOIN positions p ON p.id = s.position_id 
LEFT JOIN cities c ON c.id = b.city_id 
ORDER BY c.name, p.name;

SELECT `position`, agents_name, office, city, address FROM v_staff_office; 

-- 7.2. Представление, которое выводит id, имя и фамилию менеджеров (staff.position_id = 2) и количество агентов под их руководством.
CREATE OR REPLACE VIEW v_manager_agents (id, managers_name, agents_cnt) 
AS SELECT sb.chief_staff_id, CONCAT((SELECT s.firstname WHERE s.id = sb.chief_staff_id), ' ', (SELECT s.lastname WHERE s.id = sb.chief_staff_id)), COUNT(*)
FROM staff_branches sb
JOIN staff s ON chief_staff_id = s.id 
WHERE sb.chief_staff_id IN (SELECT s.id WHERE s.position_id = 2)
GROUP BY sb.chief_staff_id
ORDER BY COUNT(*) DESC;

SELECT id, managers_name, agents_cnt FROM v_manager_agents;

