-- 8.2. Процедура, с помощью которой выводится информация об актуальных (contracts.status = 'actual') коммерческих помещениях (real_estate_types.name = 'commerce') 
--      на продажу (contracts.aim = 'for_sale') в заданном офисе.
DROP PROCEDURE IF EXISTS p_flats_for_sale_office;
DELIMITER //
CREATE PROCEDURE p_flats_for_sale_office (office VARCHAR(150))
BEGIN
WITH all_flats_info AS (
	SELECT b.office_name, c.staff_id, re.contract_id, c.status, c.aim, ret.name `type`, c2.name city, re.district, re.street, re.building, re.apartment, re.`square_m^2`, re.num_room, re.`floor`, re.price
	FROM branches b 
	LEFT JOIN staff_branches sb ON sb.branches_id = b.id 
	LEFT JOIN staff s ON s.id = sb.staff_id 
	LEFT JOIN contracts c ON c.staff_id = s.id 
	LEFT JOIN real_estate re ON re.contract_id = c.id 
	LEFT JOIN real_estate_types ret ON ret.id = re.real_estate_type_id 
	LEFT JOIN cities c2 ON c2.id = re.city_id 
	)
	SELECT office_name, staff_id, contract_id, status, aim, `type`, city, district, street, building, apartment, `square_m^2`, num_room, `floor`, price
	FROM all_flats_info afi 
	WHERE office_name = office AND status = 'actual' AND `type` = 'commerce' AND aim = 'for_sale';
END //
DELIMITER ;

