-- 8.3. Триггер, устанавливающий площадь объекта = 5, в случае попытки вставить меньшее значение в поле real_estate.square_m^2.
DELIMITER //
DROP TRIGGER IF EXISTS check_square//
CREATE TRIGGER check_square 
BEFORE INSERT ON real_estate
FOR EACH ROW BEGIN
	IF NEW.`square_m^2` < 5 THEN
	SET NEW.`square_m^2` = 5;
	END IF;
END//
DELIMITER ;

