-- 8.4. Триггер, выводящий предупреждение (ошибку), при обновлении поля 'пол' (profiles.gender) и попытке изменения значения, на несоответствующее 'm'(male) или 'f'(female).
DELIMITER //
DROP TRIGGER IF EXISTS check_gender//
CREATE TRIGGER check_gender 
BEFORE UPDATE ON profiles
FOR EACH ROW BEGIN
	IF NEW.gender <> 'm' AND NEW.gender <> 'f' THEN
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'UPDATE canceled, VALUES must be "m" OR "f"';
	END IF;
END//
DELIMITER ;

UPDATE profiles 		-- тест
	SET gender = 'ж'
	WHERE staff_id = 1;
